import React, { useState } from 'react'
export function InfoLandingPage({width="825", height="543"}){

    const [paths, setPaths] = useState(['<path d="M640.599 151.654L638.113 152.291L723.243 484.764L725.729 484.127L640.599 151.654Z" fill="#3821C7"/>'])

    return (
        <svg width={width} height={height} viewBox="0 0 825 543" fill="none" xmlns="http://www.w3.org/2000/svg">
            <g clip-path="url(#clip0)">

                { paths.map((row, key) => 
                    <>
                    <path d="M640.599 151.654L638.113 152.291L723.243 484.764L725.729 484.127L640.599 151.654Z" fill="#3821C7"/>
                    {row}
                    </>
                )}
            </g>
            <defs>
                <clipPath id="clip0">
                    <rect width="825" height="543" fill="white"/>
                </clipPath>
            </defs>
        </svg>
    )
}
